// Definition of our tabs

const tabData = [
    {
        name: 'Tab1',
        content: <PlayerInfo />,
    },
    {
        name: 'Tab2',
        content: 'Tab 2 content',
    },
    {
        name: 'Tab3',
        content: 'Tab 3 content',
    },
    {
        name: 'Tab4',
        content: 'Tab 4 content',
    },
];

export default tabData;
